pragma solidity ^0.5.0;

contract VitalRecordService {
   string name;
   string date;
   string place;
   string phone;

function setVitalRecordChange(string memory _name, string memory _date, string memory _place, string memory _phone) public {
      name = _name;
      date = _date;
      place = _place;
      phone = _phone;

   }

   function getVitalRecordChange() public view returns (string memory,string memory, string memory,string memory) {
       return ( name,date,place,phone);

   }

}
